    playbackData.comments = {"5675308d-c394-4a3f-95b7-dba5ad1e23fa":[{"id":"e9374ea7-4b6c-4ccb-89a0-0490bc3ae7a5","displayCommentEventId":"5675308d-c394-4a3f-95b7-dba5ad1e23fa","displayCommentEventSequenceNumber":0,"developerGroupId":"cf9d3fd6-6ecb-4356-8e4f-5365c9c96a8d","timestamp":1695841061830,"commentText":"In this code story, we are going to write our own versions of two built-in Haskell list functions, <span style=\"font-family: Courier;\">maximum</span> and <span style=\"font-family: Courier;\">reverse</span>.<div><br></div><div>Since we are using Haskell's built-in list type, there's no need for a data type definition. We can just jump right in with writing functions.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"9fccbafd-f487-40c9-be96-0e43cf48a1e9":[{"id":"aca7e0f4-f531-4559-b723-954d14518603","displayCommentEventId":"9fccbafd-f487-40c9-be96-0e43cf48a1e9","displayCommentEventSequenceNumber":71,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695844408308,"commentText":"Let's start with the type declaration for <span style=\"font-family: Courier;\">maximum'</span>, since writing the type declaration often helps us to understand the problem.<div><br></div><div>Our function should take a list and return a value from that list. The values in the list should have an ordinal (<span style=\"font-family: Courier;\">Ord</span>) type, so that we can compare them.</div>","commentTitle":"Type declaration (maximum')","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"maximum' :: Ord a => [a] -> a","startRow":2,"startColumn":0,"endRow":2,"endColumn":29}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"maximum' :: Ord a => [a] -> a","commentTags":[],"questionCommentData":null}],"1019a24c-0121-4944-9754-bf634eb1159e":[{"id":"9bb89196-9a1e-42fa-9a8c-4844b69156d3","displayCommentEventId":"1019a24c-0121-4944-9754-bf634eb1159e","displayCommentEventSequenceNumber":113,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695844460664,"commentText":"If we have an empty list, it's not possible to return a value from the list; there are no values. So this isn't a true base case; it's an error case.","commentTitle":"Error case (maximum')","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"maximum' [] = error \"Empty list\"\n","startRow":3,"startColumn":0,"endRow":4,"endColumn":0}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":-1,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"40d46fa3-3bfd-45b4-afd6-21353096742e":[{"id":"b2cc2991-0e6b-4800-9e2e-4397ca5e7984","displayCommentEventId":"40d46fa3-3bfd-45b4-afd6-21353096742e","displayCommentEventSequenceNumber":140,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695844701770,"commentText":"Here's our real base case: If we have only one element followed by the empty list, then we must return that element. It's the only possible candidate for the maximum.","commentTitle":"Base case (maximum')","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"maximum' (x:[]) = x","startRow":4,"startColumn":0,"endRow":4,"endColumn":19}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"maximum' (x:[]) = x","commentTags":[],"questionCommentData":null}],"3868cbe7-a49c-4d20-a7cc-488133be9489":[{"id":"c655e7be-b76d-444a-8e92-c41cc1e566a1","displayCommentEventId":"3868cbe7-a49c-4d20-a7cc-488133be9489","displayCommentEventSequenceNumber":255,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695844835647,"commentText":"Here's the recursive case. We use pattern matching to break the list into its head (<span style=\"font-family: Courier;\">x</span>) and tail (<span style=\"font-family: Courier;\">xs</span>).<div><br></div><div>If <span style=\"font-family: Courier;\">x</span> is greater than the maximum value in the tail of the list, then <span style=\"font-family: Courier;\">x</span> is the maximum. Otherwise, we return the maximum from the tail of the list.</div><div><br></div><div>There are two problems with this code: One is syntactic and one is semantic. See if you can spot them before going on.</div>","commentTitle":"Recursive case (maximum')","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"maximum' x:xs \n  | x > maximum' xs = x\n  | otherwise       = maximum' xs","startRow":5,"startColumn":0,"endRow":7,"endColumn":33}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"maximum' x:xs \n  | x > maximum' xs = x\n  | otherwise       = maximum' xs","commentTags":[],"questionCommentData":null}],"bcb326c6-4cd0-4e15-bf9a-b283150b2227":[{"id":"03091822-4801-4af4-bd52-1aa47412e52c","displayCommentEventId":"bcb326c6-4cd0-4e15-bf9a-b283150b2227","displayCommentEventSequenceNumber":304,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695844905845,"commentText":"Let's add a test case. This should give the answer <span style=\"font-family: Courier;\">42</span>, but it doesn't. Instead we get a parse error.","commentTitle":"Testing (maximum')","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"maximum' [8,12,17,42,19,39]","startRow":0,"startColumn":23,"endRow":0,"endColumn":50}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"main = putStrLn (show (maximum' [8,12,17,42,19,39]))","commentTags":[],"questionCommentData":null}],"b43f965c-df83-4387-a4f8-0ff57bb766f9":[{"id":"d55c7439-d0d7-4aad-a5d1-38e359b36d7f","displayCommentEventId":"b43f965c-df83-4387-a4f8-0ff57bb766f9","displayCommentEventSequenceNumber":306,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695844938726,"commentText":"Here, we forgot to put parentheses around our pattern.<div><br></div><div>When we fix that, the function compiles and works as expected.</div>","commentTitle":"Fixing the parse error (maximum')","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"(x:xs)","startRow":5,"startColumn":9,"endRow":5,"endColumn":15}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"maximum' (x:xs) ","commentTags":[],"questionCommentData":null}],"9a008043-d161-44f7-9a2c-3ff6c5dc1ad3":[{"id":"1e6bb509-caa3-4cd5-aa03-0be609eb2c42","displayCommentEventId":"9a008043-d161-44f7-9a2c-3ff6c5dc1ad3","displayCommentEventSequenceNumber":317,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695845017023,"commentText":"Here's another small improvement: We can use the square bracket syntax <span style=\"font-family: Courier;\">[x]</span> to match a list with exactly one element.","commentTitle":"Improving the base case","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"[x]","startRow":4,"startColumn":9,"endRow":4,"endColumn":12}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"maximum' [x] = x","commentTags":[],"questionCommentData":null},{"id":"c760510a-511b-445b-8d6c-7f33062bbafa","displayCommentEventId":"9a008043-d161-44f7-9a2c-3ff6c5dc1ad3","displayCommentEventSequenceNumber":317,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695845427878,"commentText":"And now, here is the big semantic error: If <span style=\"font-family: Courier;\">x</span> is not the maximum, we make two recursive calls to&nbsp;<span style=\"font-family: Courier;\">maximum' xs</span>.&nbsp;<div><br></div><div>This costs us extra computation time. To be exact, it will take exponential time to compute something that should take linear time.</div>","commentTitle":"Identifying the semantic error","position":1,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"maximum' (x:xs) \n  | x > maximum' xs = x\n  | otherwise       = maximum' xs","startRow":5,"startColumn":0,"endRow":7,"endColumn":33}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"maximum' (x:xs) \n  | x > maximum' xs = x\n  | otherwise       = maximum' xs","commentTags":[],"questionCommentData":null}],"df4d3f0c-82e6-4cda-a979-8405bd753222":[{"id":"5cb33ad2-348e-4b75-92ab-0221943f50c0","displayCommentEventId":"df4d3f0c-82e6-4cda-a979-8405bd753222","displayCommentEventSequenceNumber":482,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695845621593,"commentText":"I wrote a little function to illustrate why it is that making two recursive calls instead of one results in an exponential time function. This function counts the number of times it is called.<div><br></div><div><div><span style=\"font-family: Courier;\">&gt; doubleRecursionSum 1</span></div><div><span style=\"font-family: Courier;\">1</span></div><div><span style=\"font-family: Courier;\">&gt; doubleRecursionSum 2</span></div><div><span style=\"font-family: Courier;\">3</span></div><div><span style=\"font-family: Courier;\">&gt; doubleRecursionSum 3</span></div><div><span style=\"font-family: Courier;\">7</span></div><div><span style=\"font-family: Courier;\">&gt; doubleRecursionSum 5</span></div><div><span style=\"font-family: Courier;\">31</span></div></div><div><br></div><div>You should see a pattern here. For an input of <span style=\"font-family: Courier;\">n</span>, the number of function calls is <span style=\"font-family: Courier;\">2^n-1</span>. That's exponential.</div>","commentTitle":"Counting the recursive calls","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"doubleRecursionSum :: Integer -> Integer\ndoubleRecursionSum 1 = 1\ndoubleRecursionSum n = \n  1 + (doubleRecursionSum (n-1))\n    + (doubleRecursionSum (n-1))","startRow":9,"startColumn":0,"endRow":13,"endColumn":32}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"doubleRecursionSum :: Integer -> Integer\ndoubleRecursionSum 1 = 1\ndoubleRecursionSum n = \n  1 + (doubleRecursionSum (n-1))\n    + (doubleRecursionSum (n-1))","commentTags":[],"questionCommentData":null}],"70bb14d7-5ec0-4b43-887e-b85c5ca8d2db":[{"id":"d544bd8d-5c5e-45b7-8366-525c3a06b110","displayCommentEventId":"70bb14d7-5ec0-4b43-887e-b85c5ca8d2db","displayCommentEventSequenceNumber":638,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695845677152,"commentText":"So how do we fix this problem? In this case, there's two different ways to make sure each step makes only one recursive call.&nbsp;","commentTitle":"Fixing the problem","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"84d2be52-e816-41c8-96c9-5689f1aa62ec":[{"id":"fdb57aed-46a1-47dd-af1d-e073af92c0ae","displayCommentEventId":"84d2be52-e816-41c8-96c9-5689f1aa62ec","displayCommentEventSequenceNumber":764,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695845830265,"commentText":"The first approach is to use a <span style=\"font-family: Courier;\">where</span> clause to assign a name to the result of the recursive call. Then we can use the same result twice: In the guard of the first case and in the result of the second case.","commentTitle":"Strategy 1: where clause","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"  | x > maxOfRest = x\n  | otherwise     = maxOfRest\n  where maxOfRest = maximum' xs","startRow":6,"startColumn":0,"endRow":8,"endColumn":31}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"  | x > maxOfRest = x\n  | otherwise     = maxOfRest\n  where maxOfRest = maximum' xs","commentTags":[],"questionCommentData":null}],"731dc906-3b08-4982-bd71-3596e65ac630":[{"id":"92dbd1f5-4bae-41d2-953d-59d74038eb6e","displayCommentEventId":"731dc906-3b08-4982-bd71-3596e65ac630","displayCommentEventSequenceNumber":908,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695846281151,"commentText":"By the way, this is a situation where using a conditional expression - <span style=\"font-family: Courier;\">if</span>/<span style=\"font-family: Courier;\">then</span>/<span style=\"font-family: Courier;\">else</span> - could be more readable than using guards.","commentTitle":"Conditional expression","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"maximum' (x:xs) =\n  if x > maxOfRest then x else maxOfRest","startRow":5,"startColumn":0,"endRow":6,"endColumn":40}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"maximum' (x:xs) =\n  if x > maxOfRest then x else maxOfRest","commentTags":[],"questionCommentData":null}],"de14a425-77b3-452e-9025-280e89211171":[{"id":"8bac5311-aa43-46f4-a357-bded9dedfb3a","displayCommentEventId":"de14a425-77b3-452e-9025-280e89211171","displayCommentEventSequenceNumber":1033,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695846787666,"commentText":"In Haskell, <span style=\"font-family: Courier;\">if</span>/<span style=\"font-family: Courier;\">then</span>/<span style=\"font-family: Courier;\">else</span> is an&nbsp;<i>expression</i>, and not a control structure like in Python or C++.<div><br></div><div>That means that we can put&nbsp;<span style=\"font-family: Courier;\">if</span>/<span style=\"font-family: Courier;\">then</span>/<span style=\"font-family: Courier;\">else</span>&nbsp;inside of another expression, such as the string concatenation in the <span style=\"font-family: Courier;\">tellParity</span> function. (\"Parity\" means whether an integer is even or odd.)</div>","commentTitle":"Digression: Conditional expressions","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"tellParity :: Integer -> String\ntellParity n = \n  \"The number is \" <> \n  (if (0 == mod n 2) then \"even\" else \"odd\") <>\n  \".\"","startRow":9,"startColumn":0,"endRow":13,"endColumn":5}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"tellParity :: Integer -> String\ntellParity n = \n  \"The number is \" <> \n  (if (0 == mod n 2) then \"even\" else \"odd\") <>\n  \".\"","commentTags":[],"questionCommentData":null}],"4ea8ecb6-5067-46eb-a562-b750e9cff5a9":[{"id":"4ceee1ff-e309-4b01-9f50-4409ce398f1e","displayCommentEventId":"4ea8ecb6-5067-46eb-a562-b750e9cff5a9","displayCommentEventSequenceNumber":1159,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695846843083,"commentText":"What's the other strategy for ensuring we make only one recursive call? Recall the built-in <span style=\"font-family: Courier;\">max</span> function, which returns the larger of its two inputs:<div><br></div><div><span style=\"font-family: Courier;\">&gt; max 17 42</span></div><div><span style=\"font-family: Courier;\">42</span></div>","commentTitle":"Back to our story","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"d88b6090-036a-4688-b28d-5ce482a784fe":[{"id":"905edc71-53b2-4ced-b703-550eabe1f722","displayCommentEventId":"d88b6090-036a-4688-b28d-5ce482a784fe","displayCommentEventSequenceNumber":1234,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695847042646,"commentText":"Here we can use the built-in <span style=\"font-family: Courier;\">max</span>&nbsp;function to determine which is larger: the head of the list or the result of the recursive call.<div><div><br></div><div>If the <span style=\"font-family: Courier;\">max</span> function did not already exist, could we write it? Sure we could:</div><div><br><span style=\"font-family: Courier;\">max' :: (Ord a) =&gt; a -&gt; a -&gt; a</span></div><div><span style=\"font-family: Courier;\">max' x y =&nbsp;</span></div><div><span style=\"font-family: Courier;\">&nbsp; if x &gt; y then x else y</span></div></div><div><br class=\"Apple-interchange-newline\">This approach is more concise and elegant than the first one. So why did I show you that one approach first? Because using a <span style=\"font-family: Courier;\">where</span> clause to store the result of a recursive call is a generally useful strategy to avoid making multiple recursive calls.<span style=\"font-family: Courier;\"><br></span></div>","commentTitle":"Strategy 2: max function","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"maximum' (x:xs) = max x (maximum' xs)","startRow":5,"startColumn":0,"endRow":5,"endColumn":37}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"maximum' (x:xs) = max x (maximum' xs)","commentTags":[],"questionCommentData":null}],"ba1a385e-b26b-4715-ba8b-b853102bfedc":[{"id":"e57937a4-a87f-440f-825b-5d892ef58f18","displayCommentEventId":"ba1a385e-b26b-4715-ba8b-b853102bfedc","displayCommentEventSequenceNumber":1264,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695847614430,"commentText":"Next we'll write our own version of the <span style=\"font-family: Courier;\">reverse</span> function, which takes a list and returns a new list in which the order of the elements is reversed.<div><br></div><div><span style=\"font-family: Courier;\">&gt; reverse [5,4,3,2,1]</span></div><div><span style=\"font-family: Courier;\">[1,2,3,4,5]</span></div>","commentTitle":"reverse'","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"6b80937f-4f81-4787-ac94-0819e39a0032":[{"id":"1803f332-51ce-4fdc-b081-89d7ffbd0f35","displayCommentEventId":"6b80937f-4f81-4787-ac94-0819e39a0032","displayCommentEventSequenceNumber":1348,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695848076588,"commentText":"Here's a first attempt at implementing reverse.&nbsp;<div><br></div><div>For the base case, the reverse of an empty list is, of course, just the empty list.</div><div><br></div><div>For the recursive case, we reverse the tail of the list, then tack on the head at the end. To use the <span style=\"font-family: Courier;\">++</span> operator, we have to put <span style=\"font-family: Courier;\">x</span> inside its own little list, like so: <span style=\"font-family: Courier;\">[x]</span>.</div><div><br></div><div>This works! 🎉</div><div><br></div><div>However, it is not efficient. In particular, remember that the concatenation operator, <span style=\"font-family: Courier;\">++</span>, must recursively work its way through all of the elements in the left-hand list. To concatenate a list of <span style=\"font-family: Courier;\">n</span> elements to another list, <span style=\"font-family: Courier;\">++</span> has to make <span style=\"font-family: Courier;\">n</span> recursive calls to itself.</div><div><br></div><div>So how many calls does <span style=\"font-family: Courier;\">reverse'</span> make to <span style=\"font-family: Courier;\">++</span>? In the base case, none. If the list is length 1, only one call. If the list is length 2, then 1+2=3 calls. If the list is length 3, then 1+2+3=6 calls. If the list is length n, then 1+2+3+...+n calls. As you may recall from CS 167 - and as we'll prove later in this course - the result is n(n+1)/2 or O(n^2) calls to <span style=\"font-family: Courier;\">++</span>.&nbsp;</div><div><br></div><div>That means our function takes quadractic time, for something it seems we should be able to do in linear time.</div>","commentTitle":"First attempt (reverse')","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"reverse' [] = []\nreverse' (x:xs) = (reverse' xs) ++ [x]","startRow":8,"startColumn":0,"endRow":9,"endColumn":38}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"reverse' [] = []\nreverse' (x:xs) = (reverse' xs) ++ [x]","commentTags":[],"questionCommentData":null}],"2d5200fe-720a-4b43-b499-7666dabaa1d1":[{"id":"8377a743-633e-4f29-8870-f4cae6364da2","displayCommentEventId":"2d5200fe-720a-4b43-b499-7666dabaa1d1","displayCommentEventSequenceNumber":1413,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695848342040,"commentText":"Let's try a different strategy. We are going to define a recursive helper function.&nbsp;<div><br></div><div>The first parameter will be the part of the list we haven't processed yet.</div><div><br></div><div>And the second parameter will be our \"answer so far\" - the part of the list that is already reversed.</div><div><br></div><div>For our first call to the helper function, the unprocessed part of the list is the whole list, and the already reversed part of the list is nothing, the empty list.</div>","commentTitle":"Attempt 2 (reverse')","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"reverse' xs = helper xs []","startRow":8,"startColumn":0,"endRow":8,"endColumn":26}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"reverse' xs = helper xs []","commentTags":[],"questionCommentData":null}],"cccd80b0-e506-4fb1-94e6-12ccbede4bda":[{"id":"ddfc14b9-f414-40bc-a25b-d3d59b1fe380","displayCommentEventId":"cccd80b0-e506-4fb1-94e6-12ccbede4bda","displayCommentEventSequenceNumber":1449,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695848412650,"commentText":"We can't actually write the helper function like this, but here's the idea: the first parameter is our \"to do\" list and the second parameter is the \"done\" list.","commentTitle":"Helper function parameters","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"  where helper todo done = ","startRow":9,"startColumn":0,"endRow":9,"endColumn":27}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"  where helper todo done = ","commentTags":[],"questionCommentData":null}],"5ebbb5bb-92e2-46b6-a368-5274c97b44de":[{"id":"5f00db9c-8cd9-4ed2-8c6c-c1c21eea00da","displayCommentEventId":"5ebbb5bb-92e2-46b6-a368-5274c97b44de","displayCommentEventSequenceNumber":1496,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695848515617,"commentText":"Here's a more serious attempt at the base case.<div><br></div><div>If the \"todo\" list is empty, then all the work is done, and we can simply return the work that has already been done.</div>","commentTitle":"Helper function base case","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"    helper [] done = done","startRow":10,"startColumn":0,"endRow":10,"endColumn":25}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"    helper [] done = done","commentTags":[],"questionCommentData":null}],"fb6d1c74-c8cb-4750-8ddb-5a2dfbe19a25":[{"id":"8490479d-7e6e-4084-9096-130382e280c9","displayCommentEventId":"fb6d1c74-c8cb-4750-8ddb-5a2dfbe19a25","displayCommentEventSequenceNumber":1520,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695848577339,"commentText":"If you prefer, we can call the \"done\" list <span style=\"font-family: Courier;\">reversed</span>, because it is the part of the list that has already been reversed.<br>","commentTitle":"Renaming the \"done\" list","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"    helper [] reversed = reversed","startRow":10,"startColumn":0,"endRow":10,"endColumn":33}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"    helper [] reversed = reversed","commentTags":[],"questionCommentData":null}],"74649d04-88f8-4f2c-a2af-cf51045138fe":[{"id":"9638ae02-072f-451e-8781-49e24b488faf","displayCommentEventId":"74649d04-88f8-4f2c-a2af-cf51045138fe","displayCommentEventSequenceNumber":1582,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695850050110,"commentText":"In the recursive case, we remove the head from the front of the unprocessed list, and tack it onto the front of the reversed list. We then make a recursive call with the updated \"todo\" and \"done\" lists.<div><br></div><div>Think of it as like unstacking a stack of blocks and building another stack in reverse order, one block at a time.</div>","commentTitle":"Helper function recursive case","position":0,"selectedCodeBlocks":[{"fileId":"327dd18e-6f4e-458d-b10d-482c4d3c840d","selectedText":"    helper (x:xs) reversed = helper xs (x:reversed)","startRow":11,"startColumn":0,"endRow":11,"endColumn":51}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"    helper (x:xs) reversed = helper xs (x:reversed)","commentTags":[],"questionCommentData":null},{"id":"c11bced3-7e1c-4516-be4b-f741ed358b51","displayCommentEventId":"74649d04-88f8-4f2c-a2af-cf51045138fe","displayCommentEventSequenceNumber":1582,"developerGroupId":"c12d258b-3977-475a-b75a-d56c9a46433a","timestamp":1695850253705,"commentText":"Sometimes, as in the final version of <span style=\"font-family: Courier;\">maximum'</span>, the basic pattern for list recursion gives us an efficient function implementation. But in case it doesn't, you've learned two new strategies to consider:<div><br></div><div>1. Use a <span style=\"font-family: Courier;\">where</span> clause to name the result of the recursive call, as in the first version of <span style=\"font-family: Courier;\">maximum'</span>.</div><div><br></div><div>2. Use a <span style=\"font-family: Courier;\">where</span> clause to define a recursive helper function, as in the final version of <span style=\"font-family: Courier;\">reverse'</span>.</div>","commentTitle":"Summary: Strategies for efficient list recursion","position":1,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}]};
